import React, { useState } from 'react';
import Login from './login';

export default function IndexPage() {
  const [showModal, setShowModal] = useState(false);

  const handleClose = () => setShowModal(false);
  const handleShow = () => setShowModal(true);

  return (
    <div className="container-fluid g-0">
      <div className="row">
        <div className="col-12 col-md-6">
          {/* You can add content here */}
        </div>
        <div className="col-12 col-md-6">
          <button
            className="btn btn-primary px-0 align-middle text-white fs-5 px-md-5 rounded-pill mt-4"
            onClick={handleShow}
          >
             <span className="d-none d-sm-inline">Login</span>
          </button>
          <button
            className="btn-lg px-5 btn-primary px-0 align-middle text-white fs-5 px-md-5 rounded-pill mt-4"
            onClick={handleShow}
          >
           Login
          </button>
        </div>
      </div>
      <Login show={showModal} handleClose={handleClose} />
    </div>
  );
}
